  langs:
  - csharp
  name: PrintQueueStatus
  nameWithType: PrintQueueStatus
  fullName: System.Printing.PrintQueueStatus
  type: Enum
  summary: "Especifica o estado da fila de impressão ou a impressora."
  remarks: "Como a <xref:System.Printing.PrintQueue>classe, esta enumeração processa a fila de impressão e o físico impressora (ou dispositivo) como uma unidade</xref:System.Printing.PrintQueue> Alguns valores representam o estado do dispositivo físico e outros representam o estado do programa de fila de impressão que está em execução no servidor de impressão.       Utilize esta enumeração para fornecer valores para a <xref:System.Printing.PrintQueue.QueueStatus%2A>propriedade de <xref:System.Printing.PrintQueue>classe.</xref:System.Printing.PrintQueue> </xref:System.Printing.PrintQueue.QueueStatus%2A>"
  example:
  - "The following example shows how to use this enumeration as part of a survey all printers for possible error status.  \n  \n [!code-cpp[PrinterStatusSurvey#SpotTroubleUsingQueueAttributes](~/add/codesnippet/cpp/printerstatussurvey/Program.cpp#spottroubleusingqueueattributes)]\n [!code-vb[PrinterStatusSurvey#SpotTroubleUsingQueueAttributes](~/add/codesnippet/visualbasic/printerstatussurvey/program.vb#spottroubleusingqueueattributes)]\n [!code-cs[PrinterStatusSurvey#SpotTroubleUsingQueueAttributes](~/add/codesnippet/csharp/PrinterStatusSurvey/Program.cs#spottroubleusingqueueattributes)]"
  syntax:
    content: >-
      [System.Flags]

      public enum PrintQueueStatus
